import React from 'react';
import Webimg from './img/pic2.jpg'
import Card from './Card';
const Service = () => {


  return (
    <>

      <div className='my-5'> <h1 className="text-center"> Our Searvices </h1></div>
      <Card titel="Programming" imgsrc={Webimg} inroll="Inroll The Program"/>


    </>
  );
}

export default Service;
